    "annual-marsh-and-water-management-program-report-prime-hook-national-wildlife-refuge-2002",nt"isopen":
    false,nt"url": null,nt"notes": "This report describes the results of the
    2001 field season's marsh and water level management actions and summarizes the
    planned management strategies for CY 2002. The Refuge's Annual Marsh and Water Level
    Management Program has two major goals: 1) to produce reliable plant and animal
    food resources each year comprised of mostly annual moist-soil vegetation, that
    produce large seed crops, and short-cycle invertebrates; and 2) to make areas that
    contain these food resources available to wetland dependent migratory birds. This
    report goes into great detail about how water management is impacting wildlife.",nt"license_title":
